  false,\n\t\"url\": null,\n\t\"notes\": \"F144 data were collected using salinometer
  and other instruments in the Beaufort Sea from several platforms. Data were collected
  from 07 August 1985 to 01 September 1985 by Battelle Marine Research Laboratory
  in New England area with support from the Beaufort Sea Monitoring Program.nnThe
  F144 data type contains data on ambient concentrations of toxic substances and other
  pollutants in the marine environment. The data derive from laboratory analyses of
  samples of water, sediment or marine organisms. Samples may have been collected
  near marine discharge sites or during ocean monitoring surveys of large areas. Field
  observations of tar deposits on beaches may also be reported.\",\n\t\"license_title\":
